Hi Leah!



I just posted 5 examples from one day&#39;s 5 minute session I did using
EVPMaker with Allophones.  I sent them out individually but you can always
check my folder (Kristin&#39;s Files) in the Files section.  



It does work and quite well.  I hope that helps.

Kristin



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Leahs Odyssey
Sent: Monday, September 29, 2008 12:01 PM
To: EVP-ITC@yahoogroups.com
Subject: Re: [EVP-ITC] EVP Maker



Are you talking about the computer program EVP Maker from Germany? All it
does is jumble whatever come through the mike, there is no way to be sure
you actually get anything. Unless you know something that I don&#39;t about it.



Take care,



Leah



----- Original Message ----
From: Misty Dawn &lt;bulletbabea@...&gt;
To: EVP-ITC@yahoogroups.com
Sent: Sunday, September 28, 2008 8:41:22 PM
Subject: Re: [EVP-ITC] EVP Maker

Yes and successfully! EVPmaker, , water, chainsaw, sweep tuning, you name it
LOL. I even have had a bit of live interaction while setting it up with
thier suggested settings. I have a few posted over on my esnips along with
other methods. Just look at list on left and click &quot;more folders&quot; to see the
rest of the list of diff methods. Its in there.

http://www.esnips. &lt;http://www.esnips.com/user/MistyDawn&gt;  com/user/
MistyDawn

Only a very small sample but I try to keep some good ones as well as the
ones I&#39;m sharing with friends.

Misty

